import { SHOP_NAME, SHOP_PRODUCTS } from "../../../data";
import { Product } from "./components";

import styles from "./Products.module.css";

const Products = () => {
  return (
    <ul>
      {SHOP_PRODUCTS.map(({ image, name, price, tickets, days }) => {
        return (
          <Product
            className={styles.product}
            image={image}
            name={name}
            price={price}
            tickets={tickets}
            days={days}
            key={name + image}
          />
        );
      })}
    </ul>
  );
};

export { Products };
